import React from "react";
import styled from "styled-components";
import NavBarScroll from "../components/NavBarScroll";
import SanPham from '../assets/san-pham.png';
import '../css/style.css'

export default function Product() {
    return (
        <>
            <body>
                <div className="navbar-top-space">
                    <NavBarScroll />
                </div>
                <div className="header-space" style={{ backgroundImage: `url(${SanPham})` }}>
                    <h2 style={{ color: "#fff", textAlign: "center" }}>SẢN PHẨM</h2>
                </div>
                <div className="items-space">
                    <SanPham />
                </div>

            </body>
        </>
    )
}

const FormContainer = styled.div`
height: 100vh;
width: 100vw;
display: flex;
flex-direction: column;
align-items: center;
gap: 1rem;
background-color: #fff;
.navbar-top-space{
    height: 5vh;
    width: 100vw;
    display: block;
    top: 0;
    z-index: 999;
}
.header-space{
    width: 100vw;
    height: 30vh;
    padding-top: 15vh;
    padding-bottom: 15vh;
}
.items-space{
    width: 100vw;
    height: 120vh;
    display:block;
}
.footer-space{
    width: 100vw;
    height: 70vh;
    display:block;
    background-color: #333;
    color: #fff;
}
`;
